function Experiment(props){
    const title = props.expenses[0].title;
    const date = props.expenses[0].date;
    const amount = props.expenses[0].amount;
    return(
       <div>
           <div>{title}</div>
           <div>{amount}</div>
           <div>{date}</div>
       </div>
    );
}
export default Experiment;
